(217, 'Shiv kumar Sharma', 'shiv_uniq@hotmail.com', '7976266485', 'An job Opportunity', 'see one of the best Covering Letter based on technical & personality\r\nDear Sir,\r\nI have 28.0 years of proven track records, I am looking an opportunity for suitable position(even Sr.Mgr), I have done successfully biggest Projects for Thermal Power plants(Coal Based) with BHEL, Paint Shops with (Japanese),a Caustic chlorine Plant (DCS),Pesticides, Mineral Processing,Tiles,Soap & Detergents plans, Labsa, Milk Products, Manage Strategic Planning, Operations / Production development, Maintenance and Commissioning, Manpower Management, Cost Reduction, Shift Management, Process Enhancements, Coordination and condition Monitoring, Strong Leadership, Communication skill, Responsible for building a vibrant team, managing succession planning, developing the second line and improving the culture, competency levels of the overall team, ensuring high level of safety, environment practices and ensuring compliances with relevant statutory requirements of the plant, optimizing the Spares, Stores and Inventory Management, Implement TPM,RCA,Kaizen,KPI etc., Get all in one Projects Execution, Plant Operation and Maintenance of any type, you may get more benefits so hire me ASAP-\r\n1) Project Management-Have 18 yrs Project exp.in Planning & Execution, Macro Level scheduling, Manage Technical team, timely fabrication & dispatch, quality checking as per design before dispatch, Air Pressure check & leak test, fit up check & required painting.           2) Operational, Maintenance-Make a Production Plan month wise, check available resources like-RAW material, utility, machines, man power, focus on quality and Make History & breakdowns, make notes on M/Cs Behavior ShiftWise checking, TPM & M/C cleaning etc  3) Store & Inventory Management(27Yrs)-fast consumable and spares, use ERP & Spares, tagging system, daily updates of stocks etc.       4) Heavy Fabrication, Erection(25Yrs)-House fabrication, workshop for repairing of damaged Valves, Flanges, Mechanical Seals, Fans, Installed Boiler and Accessories, use suitable Dâ€™ Shackles & wire rope & degree, check chain pulley block working, load test and certify. 5) Alignment, Repairing of Rotary Equipment(18Yrs)-Make machines repaired & aligned in workshop and provide to shifts uses timely 6) ISO-45001/EHS/Safety(5Yrs) -Ensure to control all Hazards, documented activities for safe working practice, use PPE at site uses etc.,    7) Welding Technologies(20Yrs)-Use suitable welding Machines, electrodes for welding, make safety during welding, proper earthing.  8) HR /Admin-Attendance, Over time,Punctuality,Employees Personal Files Discipline, Health ,PF, Legal documentation, audit external 9) Manpower Control-By long work experiences, meeting with union leaders and listen their problems , easy to handle them etc. 10)Training & Cost Control-Control wastage, timing loss by skilled manpower so provide technical / personality based training etc 11) Piping(18 Yrs.)-Done Piping for 110M.Watt TPS, chemical Plants, Fertilizer & Paint shop Plant and Pre fabricate and keep on Rack. 12) Various Equipment Handle-due rich experiences from various Plants & so know about many machines ,types, working systems etc. 13) Procurement & Vendor Development(12 Yrs.Exp.)-Exp. in Maintenance, Projects & Operation so easily understand whatâ€™s require with correct specs, make suitable comparisons & do prices negotiation, take standard warranty & improvement in quality of spares 14) Measuring Equipment-itâ€™s very essential to measure Machines system parameters, take readings time to time of Machines etc. 15) International Codes-know about ASTM, ASME,IS,JIS,BS,Presure Piping for Steam and Air, Chemical -B-16.3, for various work etc. 16) Increase awareness about 5S,17) Mineral Processing Plant-Managed open Mining-U/G and given more and timing production etc. 18) lead maintenance functions Successfully managed Maintenance Dept.-600 man power-Mechanical, Civil, Electrical & Instrument 19) Expert in Plant Operation/Maintenance for Pharma-Provide more than 65-75 Lacs by control of wastage of man power ,vendor negotiation & M of Boiler,HVAC, in house fabrication, preventive maintenance, follow who rules,Admin control, Proven Track records  20) Qualification/Education-Post Graduate with 29 yearâ€™s of rich an experiences with- B.E.Mechanical, Win awarded in personality etc.   21) Certifications- FAG Bearings Indi(Millennium Workshop)-2001,Success Mantra Mantra Personality Development at Mumbai-2002), 22) Profit & Loss/ PIMS-Overall responsibility of Profit & Loss, profit impact of market strategies (PIMS) of existing products/ services and advise on creating higher quality products with quicker go-to-market implementation,23) Hobbies & Expertise -Hat Yoga, Industrial & Home Vaastu and Occult Science etc,24) I.T.& Drawing Knowledge -M.S.Office, Excel, Power Point,M.S.Project,AutoCAD,P &ID,Isometric etc.25) Expert in System Set up-Increased production by system of Preventive,Pridictive Maintenance, TPM, 5S,RCA, Kaizen,KPI,Spare parts and Store inventory control, Safety ,Man power control, and cost control etc.\r\nBelieve, I have converted waste into worth, saved cost more than Rs.95-98LPA while working with Greentec Pvt Ltd and 65-70Lacs while I was working with Lark Lab.India Ltd as a G.M.Operations, I was managed Plant as a G.M Projects, Operations and Maintenance from last 7.0 Years, so Deserve for Senior Position, Pay to & fro charges for Interview, issue an Offer letter, free accommodation & conveyance & other benefits according to company rules, now accepting challenges for Prod. Plants / Upcoming Projects, Capable to manage operation-existing 4/5 Plants, I am agreed for relocate and like to join immediately on suitable salary for long term basis only for mutual benefits for India or Abroad(Tax free salary & Visa)! Hope for fruitful reply ASAP.\r\n\r\nWith Regards,\r\nâ€˜shivâ€™ kumar Sharma, Alwar, Raj.301001\r\nPhone-01442730293, Mobile no-+917976266485,8696963789\r\nEx.General Manager-Maintenance-Greentec Pvt Ltd,,Ex. G.M-Operations for Lark Laboratories Ltd,\r\nEmail-shiv_uniq@hotmail.com,shiv_kumar.sharma@hotmail.com, Skypeâ€“sksharma591.\r\nwww.linkedin.com/in/shiv-kumar-sharma-54a7bb121, https://www.linkedin.com/in/shiv-sharma-596570170\r\n\r\n', 1, '2019-11-23 07:29:05'),
