(927, 'Ujjawal Singh', 'services@colossustex.com', '9310311573', 'Business Inquiry for Cotton bags', 'Looking for 100% cotton bags having specifications:\r\n100% Cotton Recycled Fabric Bags - Yarn made from Yarn waste or Cut fabric --- But 100% Cotton. Fabric Weight - 140 to 150 gsm. Fabric made from 20s /20s yarn\r\n\r\nBag Size: 38 x 42cm  //// Handle - 1\" x 64cm. Cross Stitch at the handles. Properly Ironed.\r\n\r\nBag weight 72 gms\r\n\r\nRegards', 1, '2021-07-14 05:16:45'),
(928, 'Peter Gallagher-Witham', 'pgwxiii@gmail.com', '7427272721', 'Heavy Duty Cotton Laundry Bags', 'Looking for large laundry bags with handles and tie fastening. Ref: https://go-armynavy.com/u-s-military-soiled-clothes-large-laundry-bag/\r\n\r\nThey are to be sent to customers who will fill them with clothes and return them to us. We will need to wash the bags many times. The bag cost must be, low (not as ridiculous price for the linked product, that is vintage). \r\n\r\nWill start with 1000 bags to check that everything works. We estimate we will need 10k units on second-order and 50k on third order. Our customer target is all UK so we think we will need 500k new bags every 9 months. Just to give you some idea. \r\n\r\nWe are a clothing recycling business. Most companies ask customers to put clothing in plastic bags (which is very cheap, but very bad). We will reuse bags up to 20 times before they are recycled too. Ideally, if they can last 50 washes that will save us a lot of money. We will start the business in December 2021 and expect to grow very quickly. I had the same company in Ireland and now I am starting a new one in the UK as there are many more customers.', 1, '2021-07-16 15:03:29'),
