ied medicine at the Queen Mary University of London. Currently based in the UK she also has a passion for freelance writing and covers a broad range of topics including health, sex and relationships and fitness. When she\'s not busy writing she enjoys mediating, weightlifting and strolls around town. \r\n\r\nAbout Ieva Kubiliute\r\n\r\nIeva Kubiliute studied psychology BSc (Honours) at the university of St Andrews. She’s a keen freelance writer and consults several health and wellness brands. Ieva covers topics ranging from mental wellbeing to sex and relationships. In her spare time Ieva is passionate about yoga, movies and affordable skincare. \r\n\r\nIf you require further information or specific quotes please contact Ieva ieva@oliolusso.com', 1, '2022-05-14 07:26:13'),
