(1407, 'Austin Russell', 'russell.austin@gmail.com', '06-43172529', 'Interesting piece', 'Hi\r\n\r\nI thought the below may be an interesting piece for the blog on cotbags.com. Please feel free to publish it should you find it to be the right fit for your readers. If you have any questions, please let me know and make sure to copy in Karolina (karolina@dimepiecela.com).\r\n\r\n---\r\n\r\nLingerie, like any other fashion accessory, has undergone many transformations over the decades. From the agonising apodesme used in Ancient Greece to the peculiar pantalettes of the 1800’s we have seen it all. \r\n\r\nSex experts Katie Lasson and Tatyana Dyachenko from Dimepiece LA have created a handy infographic which delves into the changing fashion trends of lingerie over the last 100 years. \r\n\r\n\"What I found most interesting whilst doing the research for the infographic is the concept that lingerie should be visually appealing didn’t come into effect until the late 19th century.\" Katie \r\n\r\nLady Duff-Gordon of Lucile was one of the main pioneers for developing lingerie that freed women from the traditional restrictive undergarments such as corsets. The famous Flappers of the 1920’s further cemented these ideals with their blatant disregard for society standards and desire for more free-flowing lingerie. \r\n\r\nBoth Katie and Tatyana understand the important role that lingerie plays in a person sexuality and sexual experiences. The right underwear can transform the way you feel about yourself. It gives you a confidence boost that you never knew you needed. \r\n\r\nKatie had this to say \"Lingerie is a tool that, when used correctly, can help you to feel more sexy and confident. Everyone deserves to feel good in their own skin and sexy underwear has the power to transform the way you feel about yourself\". \r\n\r\nTatyana says \"Remember to wear lingerie for you, if you feel good it shines through and makes you appear more attractive to others. Confidence is sexy so embrace your body, curves and all. It’s time for you to feel good and lingerie can help you achieve that\". \r\n\r\nThe full research and infographic can be found here:\r\n\r\nhttps://dimepiecela.com/lingerie-through-the-decades-how-underwear-has-evolved/\r\n\r\nNotes To Editors: \r\n\r\nAbout Dimepiece LA\r\n\r\nDimepiece LA is your one-stop-shop for feeling sexy and confident. Here at Dimepiece LA we understand that everyone is different and has different needs and desires. That’s why we offer a range of different sexual products to tickle your fancy. We constantly expand our range so we can bring you the latest sexual tech leaving you feeling fulfilled and satisfied every time. \r\n\r\nAbout Katie Lasson\r\n\r\nKatie, a clinical sexologist and relationship advisor, is passionate about helping people feel empowered by their sexuality. \"I believe that pleasure is your birthright\". Kate helps her clients embrace their erotic potential and create more intimacy in their lives. She’s a self-proclaimed sex-geek and proudly sex-positve. \r\n\r\nAbout Tatyana Dyachenko \r\n\r\nTatyana is a sexual and relationship therapist. She’s been featured in magazines such as Cosmopolitan, Teen Vogue. Vice, Tatler, Vanity Fair, and many others. She is also a part-time sex toys blogger. In her spare time Tatyana is a tech and gaming geek and has a keen interest in graffiti, astronomy and modelling. \r\n\r\nIf you require further information or specific quotes please contact Karolina at karolina@dimepiecela.com \r\n', 1, '2022-05-26 07:41:17'),
