(2111, 'Raj Sen', 'rajnandini.sen2005@gmail.com', '9874210247', 'Inquiry about customised Tote Bags', 'Dear Cotbags,\r\n\r\nI hope this message finds you well. I am writing to inquire about the pricing and availability of custom printed tote bags for an upcoming project. We are interested in sourcing high-quality tote bags with our own custom design.\r\n\r\nCould you please provide me with the following information:\r\n\r\nPricing: Kindly share your pricing structure for custom printed tote bags. Do you offer any quantity-based discounts? Are there any additional costs associated with the customisation process?\r\n\r\nMinimum Order Quantity (MOQ): Is there a minimum quantity requirement for placing an order? If so, what is the MOQ for custom printed tote bags?\r\n\r\nCustomization Options: What customization options do you offer? Can we include our company logo, specific artwork, or text on the bags? Are there any limitations on the number of colors or the printing technique?\r\n\r\nBag Specifications: Please provide details regarding the size, material, and color options available for the tote bags. It would be helpful to know if there are multiple sizes to choose from and whether you offer eco-friendly or sustainable material options.\r\n\r\nLead Time: What is the estimated production and delivery time for a typical order of custom printed tote bags? We would appreciate having an idea of the lead time to plan our project timeline accordingly.\r\n\r\nSample Policy: Do you offer samples of the custom printed tote bags? If so, is there a cost associated with obtaining a sample? We would like to evaluate the quality and printing before finalizing our order.\r\n\r\nPayment Terms: Please provide information on your accepted payment methods and any specific terms or conditions related to the payment process.\r\n\r\nShipping: Could you provide an overview of your shipping options, including the available carriers and any associated costs or considerations? We are based in [Location], so it would be helpful to know if you can ship to our area.\r\n\r\nReferences or Portfolio: If possible, could you provide any references or a portfolio of your previous work? We would like to assess the quality of your custom printed tote bags and the satisfaction of your past clients.\r\n\r\nAdditional Information: If there is any other important information we should be aware of, such as any seasonal discounts or ongoing promotions, please feel free to share those details as well.\r\n\r\nWe are looking forward to your prompt response, as we are in the process of finalizing our project requirements. Thank you in advance for your attention to this matter.\r\n\r\nBest regards.\r\n\r\n', 1, '2023-07-07 08:47:56'),
