(451, 'Urea Series', 'Apna', 'electric-switch-and-socket-02-745057.jpg', '<p><span style=\"font-family: calibri; font-size: 14px; line-height: 23px; text-transform: capitalize;\">THESE SWITCHES ARE NOW A DAY NOT IN PASSION AND DEMOND BECAUSE OF ITS MAKING MATERIAL ACTUALLY CARBONATED BASE SWITCHES ARE OLD MODEL AND BREAKABLE. THESE BREAKAGE CAN BECAUSE MAKE IN UREA..</span></p>', '<ol>\r\n    <li>LOW COST- SUITABLE FOR EVERY HOME.</li>\r\n    <li>3 DESIGNS AVAILABLE IN SWITCH/SOCKET.</li>\r\n    <li>SHOCK &ndash; PROOF.</li>\r\n    <li>EXCELLENT PERFORMANCE.</li>\r\n    <li>DURABLE &amp; LONG LIFE.</li>\r\n</ol>', '<p>&nbsp;</p>\r\n<ul id=\"list-two\" style=\"list-style: none;\">\r\n    <li style=\"font-size: 20px; margin: 0px; border: none;\">\r\n    <table width=\"100%\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\" id=\"technical\" style=\"font-size: 14px;\">\r\n        <tbody>\r\n            <tr>\r\n                <th width=\"176\" align=\"center\">PRODUCT TYPE</th>\r\n                <th width=\"108\" align=\"center\">RATED AMP</th>\r\n                <th width=\"108\" align=\"center\">RATED VOLTAGE</th>\r\n                <th width=\"88\" align=\"center\">LIFE CYCLE</th>\r\n                <th width=\"68\" align=\"center\">COLOURS</th>\r\n                <th width=\"64\" align=\"center\">PKG.</th>\r\n            </tr>\r\n            <tr>\r\n                <td>1-WAY SWITCH.</td>\r\n                <td>6 AMP</td>\r\n                <td>230V</td>\r\n                <td>5 YRS</td>\r\n                <td>WHITE</td>\r\n                <td>20</td>\r\n            </tr>\r\n            <tr>\r\n                <td>2-WAY SWITCH</td>\r\n                <td>6 AMP</td>\r\n                <td>230V</td>\r\n                <td>5 YRS</td>\r\n                <td>WHITE</td>\r\n                <td>20</td>\r\n            </tr>\r\n            <tr>\r\n                <td>1-WAY SWITCH</td>\r\n                <td>16 AMP</td>\r\n                <td>230V</td>\r\n                <td>5