(84, 3, 'canvas bag', 'TT 3144', 'canvas-bag-tt-3144', '16 (H) x 13.5 (W) x 7 inches bottom gusset', '16 (H) x 13.5 (W) x 7 inches/ 40.64 (H) x 34.29 (W) x 17.78 Cm bottom gusset', '10 oz cotton canvas', '10 oz/ 310 GSM cotton canvas', '15 inches long cotton handles , 1 inch wide ', '15 inches/ 38.1 Cm long cotton handles , 1 inch/ 2.54 Cm wide', 'Natural, black,red, navy ', '', 'trade-show-totes-suppliers-india.jpg', '', '', '', '', '', '', '', '1', '', '', '', 'Trade Show Totes Suppliers india', 'Trade Show Totes Suppliers india', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(85, 3, 'green tote', 'TT 3240', 'green-tote-tt-3240', '13 (H) x 16 (W) x 5 inches bottom gusset', '13 (H) x 16 (W) x 5 inches/ 33.02 (H) x 40.64 (W) x 12.7 Cm bottom gusset', '10 oz cotton canvas', '10 oz/ 310 GSM cotton canvas', '22 inches long cotton handles , 1 inch wide ', '22 inches/ 55.88 Cm long cotton handles , 1 inch/ 2.54 Cm wide', 'Red,Black,Natural,Navy ', '', 'trade-show-totes-suppliers-in-india.jpg', 'Stay green and stylish on-the-go with Cotbags Green Tote, your reliable companion for eco-conscious living.', '<p dir=\"ltr\"><strong>Green Tote: </strong>Sustainable Statement Piece </p>\r\n\r\n<p dir=\"ltr\">Make an eco-friendly statement with Cotbags&#39; Green Tote, offering both style and sustainability in every stitch.</p>\r\n\r\n<p dir=\"ltr\"><strong>Statement Style, Sustainable Choice: </strong>Made from a vibrant 10 oz/310 GSM cotton canvas, this tote is a bold statement piece that&#39;s also kind to the planet.</p>\r\n\r\n<p dir=\"ltr\"><strong>Compact &amp; Surprisingly Spacious: </strong>Don&#39;t let the 13\"H x 16\"W size (33 x 40.6 cm) fool you - the 5\" (12.7 cm) gusset expands to comfortably hold all your essentials.</p>\r\n', '', '<p dir=\"ltr\"><strong>Spot Clean or Gentle Wash: </strong>For everyday cleaning, use a damp cloth to spot clean minor spills or dirt. For a deeper clean, hand wash your Cotbag with cold water and mild detergent. Avoid harsh chemicals or bleach.</p>\r\n\r\n<p dir=\"ltr\">Air Dry is Best: Skip the dryer! Line dry your Cotbag in a shaded area to prevent fading or shrinking.</p>\r\n\r\n<p dir=\"ltr\"><strong>Iron on Low (Optional): </strong>If needed, use a cool iron on the lowest setting to remove wrinkles. However, ironing is not always necessary and can damage the natural fibers of the cotton.</p>\r\n\r\n<p dir=\"ltr\"><strong>Store Flat or Hanging:</strong> When not in use, store your Cotbag flat or folded to prevent creases or misshaping.</p>\r\n', 'green tote', 'green tote', 'green tote', '1', 'india cotton tote bags ', 'india cotton tote bags ', 'india-cotton-tote-bags.jpg', 'Trade Show Totes Suppliers in india', 'Trade Show Totes Suppliers in india', '0000-00-00 00:00:00', '2024-04-25 02:08:25'),
(86, 3, 'cotton bag', 'TT 3374', 'cotton-bag-tt-3374', '16 (H) x 14 (W) inches', '16 (H) x 14 (W) inches/ 40.64 (H) x 35.56 (W) Cm', '5 oz cotton ', '5 oz/ 150 GSM cotton ', '20 inches long cotton handles , 1 inch wide ', '20 inches/ 50.8 Cm long cotton handles , 1 inch/ 2.54 Cm wide', 'Red,Black,Natural,Navy ', '', 'trade-show-totes-wholesalers-india.jpg', 'Sustainably sourced and effortlessly chic, the Cotton Bag by Cotbags is your go-to accessory for eco-conscious living.', '<p dir=\"ltr\"><strong>Cotton Bag: </strong>A Classic for Every Occasion </p>\r\n\r\n<p dir=\"ltr\">Cotbags&#39; Cotton Bag embodies simplicity and sustainability, providing a versatile accessory that effortlessly complements your daily routine.</p>\r\n\r\n<p dir=\"ltr\"><strong>Simple and Sustainable: </strong>Made from lightweight 5 oz/150 GSM cotton, this classic tote bag is a perfect choice for eco-conscious shoppers and everyday use.</p>\r\n\r\n<p dir=\"ltr\"><strong>Spacious and Comfortable: </strong>The 16\"H x 14\"W size (40.64 x 35.56 cm) offers ample room for your essentials, while the 20\" (50.8 cm) handles ensure comfortable carrying.</p>\r\n', '', '<p dir=\"ltr\"><strong>Spot Clean or Gentle Wash: </strong>For everyday cleaning, use a damp cloth to spot clean minor spills or dirt. For a deeper clean, hand wash your Cotbag with cold water and mild detergent. Avoid harsh chemicals or bleach.</p>\r\n\r\n<p dir=\"ltr\"><strong>Air Dry is Best: </strong>Skip the dryer! Line dry your Cotbag in a shaded area to prevent fading or shrinking.</p>\r\n\r\n<p dir=\"ltr\"><strong>Iron on Low (Optional): </strong>If needed, use a cool iron on the lowest setting to remove wrinkles. However, ironing is not always necessary and can damage the natural fibers of the cotton.</p>\r\n\r\n<p dir=\"ltr\"><strong>Store Flat or Hanging: </strong>When not in use, store your Cotbag flat or folded to prevent creases or misshaping.</p>\r\n', 'cotton bag', 'cotton bag', 'cotton bag', '1', '', '', '', 'Trade Show Totes Wholesalers india', 'Trade Show Totes Wholesalers india', '0000-00-00 00:00:00', '2024-04-25 02:02:51');
