(87, 3, 'organic rope tote', 'TT 3496', 'organic-rope-tote-tt-3496', '14 (H) x 14 (W) x 5 inches bottom gusset', '14 (H) x 14 (W) x 5 inches/ 35.56 (H) x 35.56 (W) x 12.7 Cm bottom gusset', '10 oz cotton canvas', '10 oz/ 310 GSM cotton canvas', '22 inches long rope handles , 1 inch wide ', '22 inches/ 55.88 Cm long rope handles , 1 inch/ 2.54 Cm wide', 'Red,Black,Natural,Navy ', '', 'trade-show-totes-wholesalers-in-india.jpg', 'Elevate your eco-friendly fashion game with the Organic Rope Tote, where sustainable materials and timeless design meet for a guilt-free, stylish statement', '<p dir=\"ltr\"><strong>Organic Rope Tote: </strong>Sustainable Style Meets Comfort</p>\r\n\r\n<p dir=\"ltr\">Elevate your eco-conscious fashion with Cotbags&#39; Organic Rope Tote, a symbol of sustainable luxury for the modern individual.</p>\r\n\r\n<p dir=\"ltr\"><strong>Eco-Conscious &amp; Effortlessly Chic: </strong>Made from 10 oz/310 GSM organic cotton canvas and featuring comfortable rope handles, this tote is the perfect blend of sustainable style and everyday functionality.</p>\r\n\r\n<p dir=\"ltr\"><strong>Compact Yet Surprisingly Spacious: </strong>Despite its smaller footprint (14\"H x 14\"W - 35.6 x 35.6 cm), the expandable 5\" (12.7 cm) bottom gusset allows it to surprisingly accommodate a variety of essentials.</p>\r\n', '', '<p dir=\"ltr\"><strong>Spot Clean or Gentle Wash:</strong> For everyday cleaning, use a damp cloth to spot clean minor spills or dirt. For a deeper clean, hand wash your Cotbag with cold water and mild detergent. Avoid harsh chemicals or bleach.</p>\r\n\r\n<p dir=\"ltr\"><strong>Air Dry is Best: </strong>Skip the dryer! Line dry your Cotbag in a shaded area to prevent fading or shrinking.</p>\r\n\r\n<p dir=\"ltr\"><strong>Iron on Low (Optional): </strong>If needed, use a cool iron on the lowest setting to remove wrinkles. However, ironing is not always necessary and can damage the natural fibers of the cotton.</p>\r\n\r\n<p dir=\"ltr\"><strong>Store Flat or Hanging: </strong>When not in use, store your Cotbag flat or folded to prevent creases or misshaping.</p>\r\n', 'organic rope tote', 'organic rope tote', 'organic rope tote', '1', '', '', '', 'Trade Show Totes Wholesalers in india', 'Trade Show Totes Wholesalers in india', '0000-00-00 00:00:00', '2024-04-25 02:00:28'),
(88, 3, 'sheeting tote', 'TT 3530', 'sheeting-tote-tt-3530', '16.5 (H) x 14.75 (W) inches', '16.5 (H) x 14.75 (W) inches/ 41.91 (H) x 37.465 (W) Cm', '5 oz cotton ', '5 oz/ 150 GSM cotton ', '22 inches long cotton handles , 1 inch wide ', '22 inches/ 55.88 Cm long cotton handles , 1 inch/ 2.54 Cm wide', 'Red,Black,Natural,Navy ', '', 'manufacturers-trade-show-totes-india.jpg', 'Whether you re running errands or heading to the farmer s market, the Sheeting Tote effortlessly combines style and practicality, simplifying your on-the-go lifestyle.', '<p dir=\"ltr\"><strong>Sheeting Tote: </strong>Light on Weight, Big on Style</p>\r\n\r\n<p dir=\"ltr\">Sleek simplicity meets everyday convenience in Cotbags&#39; Sheeting Tote, making it the perfect companion for your busy lifestyle.</p>\r\n\r\n<p dir=\"ltr\"><strong>Comfort and Style: </strong>Crafted from a lightweight 5 oz/150 GSM cotton, this tote offers comfortable carrying without compromising on style, making it your perfect everyday companion.</p>\r\n\r\n<p dir=\"ltr\"><strong>Compact and Convenient: </strong>The 16.5\"H x 14.75\"W size (41.9 x 37.5 cm) is ideal for quick trips or errands, while the long 22\" (55.88 cm) handles ensure effortless carrying.</p>\r\n', '', '<p dir=\"ltr\"><strong>Spot Clean or Gentle Wash: </strong>For everyday cleaning, use a damp cloth to spot clean minor spills or dirt. For a deeper clean, hand wash your Cotbag with cold water and mild detergent. Avoid harsh chemicals or bleach.</p>\r\n\r\n<p dir=\"ltr\"><strong>Air Dry is Best: </strong>Skip the dryer! Line dry your Cotbag in a shaded area to prevent fading or shrinking.</p>\r\n\r\n<p dir=\"ltr\"><strong>Iron on Low (Optional): </strong>If needed, use a cool iron on the lowest setting to remove wrinkles. However, ironing is not always necessary and can damage the natural fibers of the cotton.</p>\r\n\r\n<p dir=\"ltr\"><strong>Store Flat or Hanging:</strong> When not in use, store your Cotbag flat or folded to prevent creases or misshaping.</p>\r\n', 'sheeting tote', 'sheeting tote', 'sheeting tote', '1', '', '', '', 'Manufacturers Trade Show Totes India', 'Manufacturers Trade Show Totes India', '0000-00-00 00:00:00', '2024-04-25 02:09:12'),
(89, 3, 'tote bag', 'TT 3689', 'tote-bag-tt-3689', '16 (H) x 18 (W) x 4 inches bottom gusset', '16 (H) x 18 (W) x 4 inches/ 40.64 (H) x 45.72 (W) x 10.16 Cm bottom gusset', '10 oz cotton canvas', '10 oz/ 310 GSM cotton canvas', '22 inches long cotton handles , 1 inch wide ', '22 inches/ 55.88 Cm long cotton handles , 1 inch/ 2.54 Cm wide', 'Red,Black,Natural,Navy ', '', 'manufacturers-trade-show-totes-in-india.jpg', 'Versatile and durable, the Tote Bag is your trusted companion for errands, outings, and everything in between, adding a touch of sophistication to your everyday adventures.', '<p dir=\"ltr\"><strong>Classic Tote Bag: </strong>The Timeless Essential for Everyday Essentials</p>\r\n\r\n<p dir=\"ltr\">Cotbags&#39; Tote Bag is the epitome of classic elegance and functionality, offering a timeless accessory that complements any outfit with ease.</p>\r\n\r\n<p dir=\"ltr\"><strong>A Timeless Essential: </strong>This tote bag is a blank canvas for your style, perfect for everyday errands, grocery shopping, or carrying your library haul.</p>\r\n\r\n<p dir=\"ltr\"><strong>Spacious and Sturdy:</strong> Made from a substantial 10 oz/310 GSM cotton canvas, it offers a generous 16\"H x 18\"W size (40.64 x 45.72 cm) and a 4\" gusset (10.16 cm) to comfortably accommodate all your essentials.</p>\r\n', '', '<p dir=\"ltr\"><strong>Spot Clean or Gentle Wash: </strong>For everyday cleaning, use a damp cloth to spot clean minor spills or dirt. For a deeper clean, hand wash your Cotbag with cold water and mild detergent. Avoid harsh chemicals or bleach.</p>\r\n\r\n<p dir=\"ltr\"><strong>Air Dry is Best: </strong>Skip the dryer! Line dry your Cotbag in a shaded area to prevent fading or shrinking.</p>\r\n\r\n<p dir=\"ltr\"><strong>Iron on Low (Optional): </strong>If needed, use a cool iron on the lowest setting to remove wrinkles. However, ironing is not always necessary and can damage the natural fibers of the cotton.</p>\r\n\r\n<p dir=\"ltr\"><strong>Store Flat or Hanging:</strong> When not in use, store your Cotbag flat or folded to prevent creases or misshaping.</p>\r\n', 'tote bag', 'tote bag', 'tote bag', '1', '', '', '', 'Manufacturers Trade Show Totes in India', 'Manufacturers Trade Show Totes in India', '0000-00-00 00:00:00', '2024-04-25 01:26:20'),
(90, 3, 'rope tote', 'TT 3754', 'rope-tote-tt-3754', '14.25 (H) x 14 (W) x 6.5 inches side and bottom gusset', '14.25 (H) x 14 (W) x 6.5 inches/ 36.195 (H) x 35.56 (W) x 16.51 Cm side and bottom gusset', '10 oz cotton canvas', '10 oz/ 310 GSM cotton canvas', '23 inches long cotton handles , 1 inch wide ', '23 inches/ 58.42 Cm long cotton handles , 1 inch/ 2.54 Cm wide', 'Red,Black,Natural,Navy ', '', 'suppliers-trade-show-totes-india.jpg', 'From beach days to city strolls, the Rope Tote seamlessly transitions with you, adding a touch of sophistication to any ensemble.', '<p dir=\"ltr\"><strong>Rope Tote: </strong>The Stylish &amp; Spacious Choice for Everyday Adventures</p>\r\n\r\n<p dir=\"ltr\">The Rope Tote from Cotbags effortlessly blends rugged charm with everyday practicality, ensuring you&#39;re ready for any adventure in style.</p>\r\n\r\n<p dir=\"ltr\"><strong>Effortlessly Stylish, Endlessly Functional: </strong>This tote combines the natural beauty of cotton canvas with the comfort of sturdy rope handles, making it a perfect blend of style and practicality for everyday use.</p>\r\n\r\n<p dir=\"ltr\"><strong>Compact Yet Roomy: </strong>Despite its smaller footprint (14.25\"H x 14\"W - 36.2 x 35.6 cm), the spacious design with a 6.5\" (16.5 cm) side and bottom gusset surprisingly accommodates a variety of essentials.</p>\r\n', '', '<p dir=\"ltr\"><strong>Spot Clean or Gentle Wash:</strong> For everyday cleaning, use a damp cloth to spot clean minor spills or dirt. For a deeper clean, hand wash your Cotbag with cold water and mild detergent. Avoid harsh chemicals or bleach.</p>\r\n\r\n<p dir=\"ltr\"><strong>Air Dry is Best: </strong>Skip the dryer! Line dry your Cotbag in a shaded area to prevent fading or shrinking.</p>\r\n\r\n<p dir=\"ltr\"><strong>Iron on Low (Optional): </strong>If needed, use a cool iron on the lowest setting to remove wrinkles. However, ironing is not always necessary and can damage the natural fibers of the cotton.</p>\r\n\r\n<p dir=\"ltr\"><strong>Store Flat or Hanging: </strong>When not in use, store your Cotbag flat or folded to prevent creases or misshaping.</p>\r\n', 'rope tote', 'rope tote', 'rope tote', '1', '', '', '', 'Suppliers Trade Show Totes india', 'Suppliers Trade Show Totes india', '0000-00-00 00:00:00', '2024-04-25 01:21:52'),
(91, 3, 'everyday tote', 'TT 3832', 'everyday-tote-tt-3832', '15.5 (H) x 17 (W) x 3 inches bottom gusset', '15.5 (H) x 17 (W) x 3 inches/ 39.37 (H) x 43.18 (W) x 7.62 Cm bottom gusset', '10 oz cotton canvas', '10 oz/ 310 GSM cotton canvas', '', '', 'Red,Black,Natural,Navy ', '', 'suppliers-trade-show-totes-in-india.jpg', 'Elevate your daily essentials with the Everyday Tote, where practicality meets effortless sophistication.', '<p dir=\"ltr\"><strong>Everyday Tote: </strong>Your Go-To for Everyday Essentials (and More!) </p>\r\n\r\n<p dir=\"ltr\">The Everyday Tote from Cotbags combines durability with timeless style, making it your go-to accessory for any occasion.</p>\r\n\r\n<p dir=\"ltr\"><strong>Built to Brave Everyday: </strong>Crafted from a substantial 10 oz/310 GSM cotton canvas, this tote offers superior strength and structure, making it perfect for carrying heavier loads.</p>\r\n\r\n<p dir=\"ltr\"><strong>Spacious and Supportive:</strong> The generous 15.5\"H x 17\"W size (39.37 x 43.18 cm) provides ample space, while the 3\" (7.62 cm) gusset expands to comfortably accommodate all your essentials.</p>\r\n', '', '<p dir=\"ltr\"><strong>Spot Clean or Gentle Wash: </strong>For everyday cleaning, use a damp cloth to spot clean minor spills or dirt. For a deeper clean, hand wash your Cotbag with cold water and mild detergent. Avoid harsh chemicals or bleach.</p>\r\n\r\n<p dir=\"ltr\"><strong>Air Dry is Best: </strong>Skip the dryer! Line dry your Cotbag in a shaded area to prevent fading or shrinking.</p>\r\n\r\n<p dir=\"ltr\"><strong>Iron on Low (Optional):</strong> If needed, use a cool iron on the lowest setting to remove wrinkles. However, ironing is not always necessary and can damage the natural fibers of the cotton.</p>\r\n\r\n<p dir=\"ltr\"><strong>Store Flat or Hanging: </strong>When not in use, store your Cotbag flat or folded to prevent creases or misshaping.</p>\r\n', 'everyday tote', 'everyday tote', 'everyday tote', '1', '', '', '', 'Suppliers Trade Show Totes in india', 'Suppliers Trade Show Totes in india', '0000-00-00 00:00:00', '2024-04-25 01:19:06'),
(92, 3, 'economy tote', 'TT 3974', 'economy-tote-tt-3974', '15 (H) x 16.5 (W) inches', '15 (H) x 16.5 (W) inches/  38.1 (H) x 41.91 (W) Cm', '5 oz cotton', '5 oz/ 150 GSM cotton', '22 inches long cotton handles , 1 inch wide ', '22 inches/ 55.88 Cm long cotton handles , 1 inch/ 2.54 Cm wide', 'Red,Black,Natural,Navy ', '', 'wholesalers-trade-show-totes-india.jpg', 'Fashionable and functional, the Economy Tote by Cotbags offers eco-conscious consumers a versatile solution for everyday carry needs.', '<p dir=\"ltr\"><strong>Economy Tote: </strong>Your Everyday Eco-Essentials Companion</p>\r\n\r\n<p dir=\"ltr\">Designed for durability and style, the Economy Tote is the perfect companion for everyday use.</p>\r\n\r\n<p dir=\"ltr\"><strong>Simple and Sustainable: </strong>Made from lightweight 5 oz/150 GSM cotton, this tote is perfect for everyday errands and grocery shopping.</p>\r\n\r\n<p dir=\"ltr\"><strong>Spacious and Sturdy: </strong>At 15\"H x 16.5\"W (38.1 x 41.9 cm), it offers ample space for your essentials, while the long 22\" (55.88 cm) handles ensure comfortable carrying.</p>\r\n', '', '<p dir=\"ltr\"><strong>Spot Clean or Gentle Wash: </strong>For everyday cleaning, use a damp cloth to spot clean minor spills or dirt. For a deeper clean, hand wash your Cotbag with cold water and mild detergent. Avoid harsh chemicals or bleach.</p>\r\n\r\n<p dir=\"ltr\"><strong>Air Dry is Best: </strong>Skip the dryer! Line dry your Cotbag in a shaded area to prevent fading or shrinking.</p>\r\n\r\n<p dir=\"ltr\"><strong>Iron on Low (Optional): </strong>If needed, use a cool iron on the lowest setting to remove wrinkles. However, ironing is not always necessary and can damage the natural fibers of the cotton.</p>\r\n\r\n<p dir=\"ltr\"><strong>Store Flat or Hanging:</strong> When not in use, store your Cotbag flat or folded to prevent creases or misshaping.</p>\r\n', 'economy tote', 'economy tote', 'economy tote', '1', '', '', '', 'Wholesalers Trade Show Totes  india', 'Wholesalers Trade Show Totes  india', '0000-00-00 00:00:00', '2024-04-25 01:09:32');
